        //kuzeybati2_2 ayarlari çekmek icin kullanılır
        public void kuzeybatiayar2_2()
        {
            baglanti.Open();
            OleDbCommand komut1 = new OleDbCommand("Select Depo From ulastirmamodelleriayarlari where Id=1", baglanti);
            kuzeybati2_2_pl12.Controls["Depo"].Text = komut1.ExecuteScalar().ToString();
            OleDbCommand komut2 = new OleDbCommand("Select Fabrika From ulastirmamodelleriayarlari where Id=1", baglanti);
            kuzeybati2_2_pl13.Controls["Fabrika"].Text = komut2.ExecuteScalar().ToString();
            OleDbCommand komut3 = new OleDbCommand("Select Arz From ulastirmamodelleriayarlari where Id=1", baglanti);
            kuzeybati2_2_pl15.Controls["Arz"].Text  = komut3.ExecuteScalar().ToString();
            OleDbCommand komut4 = new OleDbCommand("Select Talep From ulastirmamodelleriayarlari where Id=1", baglanti);
            kuzeybati2_2_pl18.Controls["Talep"].Text = komut4.ExecuteScalar().ToString();
            OleDbCommand komut5 = new OleDbCommand("Select D1 From ulastirmamodelleriayarlari where Id=1", baglanti);
            kuzeybati2_2_pl14.Controls["D1"].Text = komut5.ExecuteScalar().ToString();
            OleDbCommand komut6 = new OleDbCommand("Select D2 From ulastirmamodelleriayarlari where Id=1", baglanti);
            kuzeybati2_2_pl14.Controls["D2"].Text = komut6.ExecuteScalar().ToString();
            OleDbCommand komut12 = new OleDbCommand("Select F1 From ulastirmamodelleriayarlari where Id=1", baglanti);
            kuzeybati2_2_pl16.Controls["F1"].Text = komut12.ExecuteScalar().ToString();
            OleDbCommand komut13 = new OleDbCommand("Select F2 From ulastirmamodelleriayarlari where Id=1", baglanti);
            kuzeybati2_2_pl16.Controls["F2"].Text = komut13.ExecuteScalar().ToString();
            baglanti.Close();
        }
