        //kuzeybati2_2 veritabanına listelemek için kullanılır
        public void kuzeybati2_2listele()
        {
            baglanti.Open();
            adp = new OleDbDataAdapter("Select * From kuzeybati2_2", baglanti);
            tablo = new DataTable();
            adp.Fill(tablo);
            kuzeybati2_2_dr1.DataSource = tablo;
            for (int i = 0; i <= 15; i++)
            {
                kuzeybati2_2_dr1.Columns[i].AutoSizeMode = DataGridViewAutoSizeColumnMode.DisplayedCells;
            }
            baglanti.Close();
        }
