        //kuzeybati2_2 hesaplama yapmak için oluşturulmuş panel6 
        private void kuzeybati2_2_pl6_Click(object sender, EventArgs e)
        {
            try
            {
                int x11 = 0, x12 = 0, x21 = 0, x22 = 0, c11 = 0, c12 = 0, c21 = 0, c22 = 0;
                foreach (Control p3 in Controls)
                {
                    if (kuzeybati2_2_pl3 is Panel)
                        foreach (Control tb in p3.Controls)
                        {
                            if (kuzeybati2_2_tb1 is TabControl)
                                foreach (Control tb1_1 in tb.Controls)
                                {
                                    if (kuzeybati2_2_tb1_1 is TabPage)
                                        foreach (Control p5 in tb1_1.Controls)
                                        {
                                            if (kuzeybati2_2_pl5 is Panel)
                                                foreach (Control p in p5.Controls)
                                                {
                                                    if (kuzeybati2_2_ortap is Panel)

                                                        foreach (Control txt in p.Controls)
                                                        {
                                                            if (txt is TextBox)
                                                            {
                                                                if (txt.Text == "")
                                                                {
                                                                    txt.Text = "0";
                                                                }
                                                                else
                                                                {
                                                                    if (txt.Name == "txt_x1")
                                                                    {
                                                                        //X11
                                                                        x11 = Convert.ToInt32(txt.Text);
                                                                    }
                                                                    if (txt.Name == "txt_x2")
                                                                    {
                                                                        //x21
                                                                        x21 = Convert.ToInt32(txt.Text);
                                                                    }
                                                                    if (txt.Name == "txt_x3")
                                                                    {
                                                                        //X12
                                                                        x12 = Convert.ToInt32(txt.Text);
                                                                    }
                                                                    if (txt.Name == "txt_x4")
                                                                    {
                                                                        //X22
                                                                        x22 = Convert.ToInt32(txt.Text);
                                                                    }
                                                                    if (txt.Name == "txt_c1")
                                                                    {
                                                                        c11 = Convert.ToInt32(txt.Text);
                                                                    }
                                                                    if (txt.Name == "txt_c2")
                                                                    {
                                                                        c21 = Convert.ToInt32(txt.Text);
                                                                    }
                                                                    if (txt.Name == "txt_c3")
                                                                    {
                                                                        c12 = Convert.ToInt32(txt.Text);
                                                                    }
                                                                    if (txt.Name == "txt_c4")
                                                                    {
                                                                        c22 = Convert.ToInt32(txt.Text);
                                                                    }
                                                                }
                                                            }
                                                        }
                                                }
                                        }
                                }
                        }
                }
                string f1toplam = (x11 + x12).ToString();
                string d1toplam = (x11 + x21).ToString();
                string f2toplam = (x21 + x22).ToString();
                string d2toplam = (x12 + x22).ToString();
                kuzeybati2_2_pl17.Controls["txtf1"].Text = f1toplam.ToString();
                kuzeybati2_2_pl17.Controls["txtf2"].Text = f2toplam.ToString();
                kuzeybati2_2_pl19.Controls["txtd1"].Text = d1toplam.ToString();
                kuzeybati2_2_pl19.Controls["txtd2"].Text = d2toplam.ToString();
                kuzeybati2_2_pl20.Controls["txtarztop"].Text = (Convert.ToInt32(kuzeybati2_2_pl17.Controls["txtf1"].Text) + Convert.ToInt32(kuzeybati2_2_pl17.Controls["txtf2"].Text)).ToString();
                kuzeybati2_2_pl20.Controls["txttaleptop"].Text = (Convert.ToInt32(kuzeybati2_2_pl19.Controls["txtd1"].Text) + Convert.ToInt32(kuzeybati2_2_pl19.Controls["txtd2"].Text)).ToString();
                kuzeybati2_2_pl4.Controls["tuls"].Text = ((x11 * c11) + (x12 * c12) + (x21 * c21) + (x22 * c22)).ToString();             
                if (kuzeybati2_2_pl20.Controls["txtarztop"].Text == kuzeybati2_2_pl20.Controls["txttaleptop"].Text && f1toplam == kuzeybati2_2_pl17.Controls["txtf1"].Text && d1toplam == kuzeybati2_2_pl19.Controls["txtd1"].Text && d2toplam == kuzeybati2_2_pl19.Controls["txtd2"].Text && f2toplam == kuzeybati2_2_pl17.Controls["txtf2"].Text)
                {
                    baglanti.Open();
                    string sorgu = "Insert into kuzeybati2_2(D1,D2,F1,F2,Arz_Toplam,Talep_Toplam,C11,C12,X11,X12,C21,C22,X21,X22,Toplam_Ulastirma_Maliyeti) values(@D1,@D2,@F1,@F2,@Arz_Toplam,@Talep_Toplam,@C11,@C12,@X11,@X12,@C21,@C22,@X21,@X22,@Toplam_Ulastirma_Maliyeti)";
                    komut = new OleDbCommand(sorgu, baglanti);
                    komut.Parameters.AddWithValue("@D1", kuzeybati2_2_pl19.Controls["txtd1"].Text.ToString());
                    komut.Parameters.AddWithValue("@D2", kuzeybati2_2_pl19.Controls["txtd2"].Text.ToString());
                    komut.Parameters.AddWithValue("@F1", kuzeybati2_2_pl17.Controls["txtf1"].Text.ToString());
                    komut.Parameters.AddWithValue("@F2", kuzeybati2_2_pl17.Controls["txtf2"].Text.ToString());
                    komut.Parameters.AddWithValue("@Arz_Toplam", kuzeybati2_2_pl20.Controls["txtarztop"].Text.ToString());
                    komut.Parameters.AddWithValue("@Talep_Toplam", kuzeybati2_2_pl20.Controls["txttaleptop"].Text.ToString());
                    komut.Parameters.AddWithValue("@C11", c11.ToString());
                    komut.Parameters.AddWithValue("@C12", c12.ToString());
                    komut.Parameters.AddWithValue("@X11", x11.ToString());
                    komut.Parameters.AddWithValue("@X12", x12.ToString());

                    komut.Parameters.AddWithValue("@C21", c21.ToString());
                    komut.Parameters.AddWithValue("@C22", c22.ToString());
                    komut.Parameters.AddWithValue("@X21", x21.ToString());
                    komut.Parameters.AddWithValue("@X22", x22.ToString());
                    komut.Parameters.AddWithValue("@Toplam_Ulastirma_Maliyeti", kuzeybati2_2_pl4.Controls["tuls"].Text.ToString());

                    komut.ExecuteNonQuery();
